		punchline:"why should I say",
		},
		{
		question:"hello",
		punchline:`bye`,
		},
		{
		question:"hello",
		punchline:"bye",
		}
		]
		
	
	
	return(
	<>{datas.map((data)=> (
	<Joke data={data}/>
	))}
	
		</>
		)
		}
export default App;
